import React from "react";
import { useSelector } from "react-redux";
import Button from "./Button";
import { selectButtons } from "../store/buttonSlice";
import DrawPopup from './DrawPopup';
import { useState } from "react";

const Navbar = () => {
  const [showPopup, setShowPopup] = useState(false);

  return (
    <div className="navbar bg-gray-800 text-white p-4 flex items-center">
      <button
        className="p-2 bg-blue-500 rounded hover:bg-blue-600"
        onClick={() => setShowPopup(true)}
      >
        Add Feature
      </button>
      {showPopup && <DrawPopup onClose={() => setShowPopup(false)} />}
    </div>
  );
};

export default Navbar;
